import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

export default class GlobalCauseRow extends React.Component {
	constructor(props) {
		super(props);
	}

	render() {
		console.log(this.props);
		return (
			<div className="death">
				<div className="year">{this.props.date}</div>
				<div className="confirmed">{this.props.confirmed}</div>
                <div className="recovered">{this.props.recovered}</div>
                <div className="deaths_globally">{this.props.deaths_globally}</div>
			</div>
		);
	}
}
